import React, { useState } from "react";
import { logoutApp } from "../helpers/auth";

function Chat() {

  const handleGoogleLogOut = async () => {
    try {
      await logoutApp();
    } catch (error) {
     console.log(error);
    }
  };

  return (
    <div>

    Chat

    <button
      type="button"
      className="sign-social-btn google-login"
      onClick={handleGoogleLogOut}
    />

    </div>

  );
}

export default Chat;
